import React from 'react';
import {makeStyles} from '@material-ui/core'
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Image from "./jd.jpg";
import Typography from '@material-ui/core/Typography';
import CardActions from '@material-ui/core/CardActions';
import Button from '@material-ui/core/Button';
import AddShoppingCartOutlinedIcon from '@material-ui/icons/AddShoppingCartOutlined';
import MonetizationOnOutlinedIcon from '@material-ui/icons/MonetizationOnOutlined';
import AlertComponent from './AlertComponent';
const useStyles = makeStyles((theme)=>({

    image:{
        height: 140
    },
    root:{
        marginTop: theme.spacing(4),
        width: "100%"
    }
}))


export default function ItemCard(data){
    const classes = useStyles();

    return(
        <Card className={classes.root}>
            <CardActionArea>
                <CardMedia
                className={classes.image}
                //src={data.image}
                src={Image}
                title="image"
                />
                <CardContent>
                    <Typography
                    variant="h5"
                    color="primaryText"
                    >
                        {/*data.title*/}
                        Sample Title
                    </Typography>
                    <Typography
                    variant="p"
                    color="primaryText"
                    >
                        Quas hic ipsam aut atque. Facere cumque ut distinctio quis alias est et minus. Inventore amet mollitia itaque. Corrupti nemo nihil itaque. Consequuntur voluptatum libero fugit eligendi ut harum maiores.
                    </Typography>
                </CardContent>
                <CardActions>
                    <Button
                    variant="outlined"
                    color="primary"
                    startIcon={<AddShoppingCartOutlinedIcon/>}
                    >
                        Add to the basket
                    </Button>
                    <Button
                    variant="outlined"
                    color="secondary"
                    onClick={<AlertComponent 
                        CloseSnackbar={data.CloseSnackbar}
                        open={data.open}
                        severity="jd"
                        message="jd"
                        />}
                    startIcon={<MonetizationOnOutlinedIcon/>}

                    >
                        Buy now!
                    </Button>
                </CardActions>
            </CardActionArea>
        </Card>
    )
}
